input = ""
left = 0
right = 13
finished = False
while not finished:
    finished = True
    for i in range(left, right):
        for j in range(right, i, -1):
            if input[i] == input[j]:
                left = i + 1
                right = i + 14
                finished = False
                break
        if not finished:
            break
    
print(right + 1)

